import React from "react";
import Card from "react-bootstrap/Card"

function MortgageDataCard(props) {
    console.log(props)
    return (
        <>
            <Card.Title>
                Principle and Interest: {props.mortgageData.principalAndInterest}
            </Card.Title>
            <Card.Title>
                Taxes: {props.mortgageData.taxes}
            </Card.Title>
            <Card.Title>
                Home Insurance: {props.mortgageData.homeInsurance}
            </Card.Title>
            <Card.Title>
                Mortgage Insurance: {props.mortgageData.mortgageInsurance}
            </Card.Title>
        </>
    )
}

export default MortgageDataCard
